(729, 'options_about_us', 'Với chúng tôi, tổ ấm là nơi sự sống bắt đầu và tình yêu không bao giờ kết thúc, vì vậy, trong mỗi trái tim của người phụ nữ đều lấp lánh ước mơ giống như đệ nhất phu nhân Mỹ: Một tổ ấm An lành. Tổ ấm là nơi những đứa trẻ - kết tinh của tình yêu đôi lứa - sinh ra, thế nên những bước chân đầu tiên khi con chập chững biết đi, khi con chạy nhảy nô đùa sẽ là chân trần chạy trên những thảm cỏ mượt mà; Không khí mỗi ngày con tận hưởng sẽ trong lành như giọt sương sớm; Màu sắc đầu tiên con nhận biết sẽ là màu xanh của hoa lá; Những người đầu tiên con tiếp xúc là những người chan hòa, đầy lòng nhân ái; Những món ăn đầu tiên con ăn sẽ ngon và lành tuyệt đối; Trường học đầu tiên của con chính là thiên nhiên và kế đó là những hệ thống giáo dục tiên tiến. Tổ ấm của con sẽ là vườn cổ tích kỳ diệu nhất, là miền ký ức đẹp nhất, theo con suốt đường đời.Anland Complex nằm tại vị trí vàng, đắc địa, là cửa ngõ của khu Đô thị Dương Nội, được xây dựng trên khu đất rộng 7052m2 với mật độ xây dựng chỉ chiếm 35%, diện tích còn lại được dành cho khuôn viên cây xanh, cảnh quan và tiện tích công cộng. Dự án bao gồm hai tòa nhà cao 25 tầng nổi, gồm 551 căn hộ và được bố trí 8 thang máy tốc độ cao, 2 tầng hầm sử dụng làm phòng kỹ thuật và đỗ xe. Đặc biệt, Anland đã chính thức được trao chứng chỉ sử dụng tài nguyên hiệu quả – EDGE (Excellence in Design for Greater Efficiencies) của Tổ chức tài chính Quốc tế (IFC) thuộc Ngân hàng Thế giới (WB). Theo đó, cư dân có thể tiết kiệm từ 20% đến 27% hóa đơn điện nước. Phía Tây Anland Complex nhìn ra công viên Thiên văn rộng 12 ha với trung tâm là hồ Bách Hợp Thủy. Lần đầu tiên được xây dựng tại Việt Nam, công viên Thiên văn –được Tập đoàn Nam Cường kết hợp với Viện hàn lâm khoa học và công nghệ Việt Nam – sẽ tái hiện sinh động quá trình hình thành vũ trụ, hệ mặt trời thông qua các mô hình, hệ thống kính thiên văn quan sát bầu trời.', 'no'),
