(955, 'options_main_service', 'Ươm những mầm xanh trong tòa Bạch ốc, chỉ có thể là ý tưởng từ trái tim quá đỗi dịu dàng của người phụ nữ. Có thể với ai đó, màu xanh nơi này cho chúng ta những liên tưởng sâu xa về hòa bình nhân loại, nhưng với những người phụ nữ như chúng tôi thông điệp chỉ giản dị là giúp con người hòa mình cùng thiên nhiên với ước mơ mà ai ai cũng có, cho dù đó là người dân thường hay đệ nhất phu nhân Mỹ: Ước mơ về một cuộc sống An lành! . Cũng giống như việc chọn cho mình một chốn đi về để đánh dấu sự thành công trong sự nghiệp hay bắt đầu một giai đoạn mới của đời người, trong khi những người đàn ông dành trọn sự quan tâm cho kết cấu của những bê tông cốt thép, thì ước mơ của phụ nữ chúng tôi lại vượt ra khỏi ranh giới của bốn bức tường để hướng tới những gì mềm mại và ý nghĩa hơn.', 'no'),
