(1431, 'options_op_about_us', 'Với chúng tôi, tổ ấm là nơi sự sống bắt đầu và tình yêu không bao giờ kết thúc, vì vậy, trong mỗi trái tim của người phụ nữ đều lấp lánh ước mơ giống như đệ nhất phu nhân Mỹ: Một tổ ấm An lành. Tổ ấm là nơi những đứa trẻ - kết tinh của tình yêu đôi lứa - sinh ra, thế nên những bước chân đầu tiên khi con chập chững biết đi, khi con chạy nhảy nô đùa sẽ là chân trần chạy trên những thảm cỏ mượt mà; Không khí mỗi ngày con tận hưởng sẽ trong lành như giọt sương sớm; Màu sắc đầu tiên con nhận biết sẽ là màu xanh của hoa lá; Những người đầu tiên con tiếp xúc là những người chan hòa, đầy lòng nhân ái; Những món ăn đầu tiên con ăn sẽ ngon và lành tuyệt đối; Trường học đầu tiên của con chính là thiên nhiên và kế đó là những hệ thống giáo dục tiên tiến.', 'no'),
(1432, '_options_op_about_us', 'field_5bfcf97fa15c4', 'no'),
