(1444, 'options_op_our_service', 'Là một tập đoàn năng lượng toàn cầu hoạt động trong một thế giới đầy thách thức, chúng tôi đặt ra cho mình những tiêu chuẩn cao về hiệu suất làm việc và hành vi đạo đức của mình. Chúng tôi được đánh giá qua hành động của chính mình - danh tiếng của chúng tôi được đề cao bởi chính cách mà chúng tôi hoạt động đúng theo giá trị của mình: trung thực, liêm chính và tôn trọng con người. Tám Nguyên tắc Kinh doanh của chúng tôi dựa trên những giá trị cốt lõi này và cho thấy niềm tin, sự cởi mở, tính đoàn kết, chuyên nghiệp và niềm tự hào về những gì chúng tôi đang làm.\r\n\r\nChúng tôi là một trong những công ty toàn cầu đầu tiên đã phát biểu và chia sẻ niềm tin của mình khi phát hành Bộ nguyên tắc Kinh doanh Chung của Shell vào năm 1976. Là một phần của những nguyên tắc này, chúng tôi cam kết đóng góp vào sự phát triển bền vững, cân bằng giữa lợi ích ngắn hạn và dài hạn, và cân nhắc cả khía cạnh kinh tế, môi trường và xã hội khi đưa ra quyết định của mình.', 'no'),
