(1470, 'options_op_hp_main_service', 'Là một tập đoàn năng lượng toàn cầu hoạt động trong một thế giới đầy thách thức, chúng tôi đặt ra cho mình những tiêu chuẩn cao về hiệu suất làm việc và hành vi đạo đức của mình. Chúng tôi được đánh giá qua hành động của chính mình - danh tiếng của chúng tôi được đề cao bởi chính cách mà chúng tôi hoạt động đúng theo giá trị của mình: trung thực, liêm chính và tôn trọng con người. Tám Nguyên tắc Kinh doanh của chúng tôi dựa trên những giá trị cốt lõi này và cho thấy niềm tin, sự cởi mở, tính đoàn kết, chuyên nghiệp và niềm tự hào về những gì chúng tôi đang làm.Để rồi anh tôi về trong hơi rượu nồng nặc, bà tôi lại thay quần áo, cởi giầy rồi vịn anh vào giường.  Nhưng hiếu đạo nào có phải báo đáp bằng tiền bạc mà được? Điều các bà cần nhỏ nhoi lắm, đó là những ân cần, quan tâm chăm sóc của con cháu. Hay đôi khi chỉ là những lời hỏi thăm ngắn ngủi. Chỉ vậy thôi là các bà đã hạnh phúc lắm rồi. Tôi tình cờ đọc được dòng chia sẻ của một cô bạn 9x đang thực tập điều dưỡng tại một viện dưỡng lão ở Hà Nội. Và thực sự những tâm sự của bạn đã giúp tôi cảm nhận rõ hơn nỗi lòng của ông bà mình', 'no'),
