(1475, '_options_op_hp_about_us_img', 'field_5bf7d23798359', 'no'),
(1476, 'options_op_hp_about_us', 'Với chúng tôi, tổ ấm là nơi sự sống bắt đầu và tình yêu không bao giờ kết thúc, vì vậy, trong mỗi trái tim của người phụ nữ đều lấp lánh ước mơ giống như đệ nhất phu nhân Mỹ: Một tổ ấm An lành. Tổ ấm là nơi những đứa trẻ - kết tinh của tình yêu đôi lứa - sinh ra, thế nên những bước chân đầu tiên khi con chập chững biết đi, khi con chạy nhảy nô đùa sẽ là chân trần chạy trên những thảm cỏ mượt mà; Không khí mỗi ngày con tận hưởng sẽ trong lành như giọt sương sớm; Màu sắc đầu tiên con nhận biết sẽ là màu xanh của hoa lá; Những người đầu tiên con tiếp xúc là những người chan hòa, đầy lòng nhân ái; Những món ăn đầu tiên con ăn sẽ ngon và lành tuyệt đối; Trường học đầu tiên của con chính là thiên nhiên và kế đó là những hệ thống giáo dục tiên tiến.Nhắc về bà có lẽ ai cũng có những người bà của riêng mình. Hình ảnh bà hiện lên với tấm lưng còng, tảo tần, chân quê, mò cua bắt ốc ngoài đồng ruộng. Hay một người bà đài các, thanh lịch trong tấm áo dài nhung – người vốn xuất thân từ vùng đất kinh kỳ ngàn năm văn hiến. Chúng ta nhớ khuôn mặt phúc hậu, nụ cười hiền từ, cùng những câu chuyện cổ tích bà vẫn thường kể khi ta còn thơ bé. Cũng có khi... bà chỉ còn lại trong miền kí ức xa xưa, người mà ta chưa một lần gặp gỡ.Suốt một đời các bà lúc nào cũng dành trọn tình yêu thương cho con cháu, luôn vun vén hạnh phúc cho gia đình. Ngày còn trẻ, khi đang ở độ tuổi xuân sắc nhất, các bà phải chịu cảnh gối chiếc, cô đơn lẻ bóng vì chồng ra chiến trận, đi theo tiếng gọi của Tổ quốc. Gác lại hạnh phúc cá nhân, không một lời ca thán, những người phụ nữ mạnh mẽ ấy tiễn chồng ra tận xe lửa, vẫy tay chào cùng lời hẹn ước gặp lại nhau khi đất nước giải phóng. Nụ cười nở trên môi nhưng sao đầy chua xót, bởi miệng cười nhưng lệ đổ trong tim. Có ai chịu được cảnh chia ly, nhất là khi biết người thương của ta đang tới nơi mưa bom bão đạn, lành ít dữ nhiều.\r\n Để rồi trái tim những người phụ nữ ấy như vỡ vụn khi nhận được giấy báo tử của người chồng họ vẫn luôn trông ngóng bóng hình. Nén lại nỗi đau thương mất mát, những người phụ nữ ấy lại mạnh mẽ đứng dậy để chăm lo cho đàn con thơ nay đã thiếu vắng đi hơi ấm của tình cha. Những tưởng cuộc đời sau này sẽ tốt đẹp hơn khi con cháu giờ đã khôn lớn, trưởng thành nhưng nào có được vậy… Nhịp sống hối hả cùng vòng xoáy của lợi danh, tiền bạc đã khiến những người con, người cháu quên mất sự hiện diện của người mẹ, người bà vẫn đang tựa cửa ngóng chờ. Tôi nhớ mãi không quên đêm đông của 15 năm về trước, hình ảnh bà ngồi mãi trước hiên nhà để chờ anh tôi về. Bà nói lòng bất an, khi nào nhìn thấy anh tôi bà mới yên tâm ngủ được.', 'no'),
