(348, 1, '2018-11-27 13:57:20', '2018-11-27 06:57:20', 'Hotcourses International thuộc Tập đoàn Hotcourses. Ra đời vào năm 1996 với hơn 300 nhân viên đến từ các văn phòng tại London, Sydney, Delhi, Chennai và Boston, tập đoàn Hotcourses đã xây dựng các trang web so sánh tìm kiếm khóa học toàn diện nhất trên thế giới.\r\n\r\nHotcourses Việt Nam là nơi tổng hợp tất cả các chương trình học (hiện có trên 350.000 chương trình) có sẵn tại 78 quốc gia. Thông qua Ultimate Search (công cụ Tìm kiếm Tối ưu), sinh viên có thể tìm thấy thông tin chi tiết về các khóa học và lựa chọn chương trình phù hợp với bậc học và điểm IELTS để thỏa mãn các yêu cầu tuyển sinh đầu vào. Ngoài ra, sinh viên cũng có thể tải cẩm nang du học chính thức của trường, liên lạc thẳng với nhà trường và tham khảo nhận xét của các cựu du học sinh. Những bài viết và video có nội dung bao quát của chúng tôi giúp sinh viên nắm bắt tất cả các bước quan trọng trên hành trình du học, từ khâu tìm kiếm thông tin, nộp đơn, xin thị thực cho đến các cơ hội việc làm sau khi tốt nghiệp.\r\n\r\nĐằng sau Hotcourses International là đội ngũ các biên tập viên và chuyên viên kỹ thuật số bản địa, xây dựng các nội dung bài viết bằng ngôn ngữ địa phương và quản lý hoạt động truyền thông xã hội tại nhiều quốc gia trên thế giới. Đối với sinh viên Ấn Độ, Hotcourses Ấn Độ còn cung cấp dịch vụ tư vấn giải đáp trực tuyến.', 'Giới thiệu', '', 'inherit', 'closed', 'closed', '', '115-revision-v1', '', '', '2018-11-27 13:57:20', '2018-11-27 06:57:20', '', 115, 'http://dilavi.dienkim/115-revision-v1', 0, 'revision', '', 0),
(349, 1, '2018-11-27 13:57:53', '2018-11-27 06:57:53', 'There are many variations of passages of Lorem Ipsum available, but the majority have suffered alteration in some form, by injected humour, or randomised words which don\'t look even slightly believable. If you are going to use a passage of Lorem Ipsum, you need to be sure there isn\'t anything embarrassing hidden in the middle of text. All the Lorem Ipsum generators on the Internet tend to repeat predefined chunks as necessary, making this the first true generator on the Internet. It uses a dictionary of over 200 Latin words, combined with a handful of model sentence structures, to generate Lorem Ipsum which looks reasonable. The generated Lorem Ipsum is therefore always free from repetition, injected humour, or non-characteristic words etc.', 'About us', '', 'inherit', 'closed', 'closed', '', '257-revision-v1', '', '', '2018-11-27 13:57:53', '2018-11-27 06:57:53', '', 257, 'http://dilavi.dienkim/257-revision-v1', 0, 'revision', '', 0),
